function Login() {
  return (
    <div className="Login">
      <div className="flex flex-col justify-center items-center h-screen">
        <input type="text" placeholder="Email" className="border p-3 mb-3 rounded-md" />
        <input type="password" placeholder="Password" className="border p-3 rounded-md" />
        <button type="submit" className="bg-blue-800">Sign In</button>
      </div>
    </div>
  );
}

export default Login;
